import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";

const theme = createMuiTheme({
  typography: {
    fontFamily: ["Kanit"],
  },
  background: {
    default: "#A63D40",
  },
});

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
